DROP TABLE IF EXISTS datita;
CREATE TABLE IF NOT EXISTS datita(
    id_datita INT AUTO_INCREMENT PRIMARY KEY,
    apellido_p VARCHAR(20),
    apellido_m VARCHAR(20),
    nombres VARCHAR(20),
    zona VARCHAR(3),
    rg VARCHAR(4),
    seccion VARCHAR(4),
    casilla VARCHAR(2),
    pos VARCHAR(2),
    clave_e VARCHAR(20),
    tel VARCHAR(10)
)ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

